import React from 'react';
import './App.css';

function Nav(){
    return (
        <nav>
            <u1>
              <li>Home</li>
              <li>BanPage</li>
              <li>Page1</li>
              <li>Page2</li>
            </u1>
        </nav>
    );
}

export default Nav;

